Every specific biz logic should be put into each specific module, and then mount these modules into the app instance described above. You can look into the article.rs file to get a concrete picture of the structure of a module. First, you need to define a struct type, like: pub struct ArticleModule; and implement the Module trait on it, to fill the router with some url endpoints: impl Module for ArticleModule { fn router(&self, router: &mut Router) -> Result<()> { router.get("/article/:id", Self::get_one); router.post("/article/new", Self::new_article); router.post("/article/update", Self::update); router.post("/article/delete/:id", Self::delete); Ok(()) }
} The above snippet fills the url router Router by implementing the fn router, the router supports two kinds of methods: get and post, correspond to the HTTP GET and POST methods respectively. Besides that, in the trait Module, we can implement the second level filters: before() and after(). These two filters apply on the url matches within this local module, not affecting other urls in other modules. So it is a kind of filter in module level. The EightFish::Module is defined as follow: pub trait EightFishModule: Sync + Send { /// module before filter, will be executed before handler fn before(&self, _req: &mut EightFishRequest) -> Result<()> { Ok(()) } /// module after filter, will be executed after handler fn after(&self, _req: &EightFishRequest, _res: &mut EightFishResponse) -> Result<()> { Ok(()) } /// module router method, used to write router collection of this module here fn router(&self, router: &mut EightFishRouter) -> Result<()>;
}

