EightFish designs some helper macros to improve the experience of logic coding, especially on interacting with SQL db. EightFish provides a derived macro named EightFishModel for user's model. For example, you just need to put this macro into the derive section above a model (struct) definition. #[derive(Debug, Clone, Serialize, Deserialize, EightFishModel, Default)]
pub struct Article { id: String, title: String, content: String, authorname: String,
} After that, the struct Article will gain some powerful functionalities like: fn model_name() -> String {}
fn field_names() -> String {}
fn build_insert_sql() -> String {}
fn from_row(row: Vec<DbValue>) -> #ident {}
... These functionalities make you write biz code easily, rapidly and happily. You can refer to the detailed inline doc here .

